import React, { Component} from 'react';
import { connect } from 'react-redux'
import { Navbar,Container,Nav ,Image} from 'react-bootstrap';
class Home extends Component {
    render() { 
        const {authedUser,users} = this.props
        const user = users[authedUser]
        return (
            <Navbar bg="dark" variant="dark" >
            <Container>
            <Navbar.Brand href="#home">Would You ?</Navbar.Brand>
            <Nav className="me-auto">
              <Nav.Link href="#home" active>Home</Nav.Link>
              <Nav.Link href="#features">Features</Nav.Link>
              <Nav.Link href="#pricing">Pricing</Nav.Link>
              Nav
              {authedUser ?
              <Nav className="justify-content-end">
                    <Nav.Link href="#home" className="nav-avatar" >
                        Hello, {user.name}
                       <Image style={{width:'25px',height:'25px', backgrounColor:'#fff'}} rounded src={user!== 'undefined' ? user.avatarURL : 'logo'}/>
                    </Nav.Link>
                    <Nav.Link href="#pricing">Log out</Nav.Link>
                    </Nav>
                    : <div></div>}
            </Nav>
            </Container>
          </Navbar>
        );
    }
}
function mapStateToProps ({authedUser,users}) {
    return {
        authedUser,
        users
    }
} 
export default connect(mapStateToProps)(Home);
